CREATE TABLE Function (
	ID INT,
	FunctionName VARCHAR(64),
	Signature VARCHAR(403),
	ClassID INT,
	IsVirtual INT,
	IsImplicit INT,
	FileID INT,
	PRIMARY KEY(ID),
	FOREIGN KEY(ClassID) REFERENCES Class(ID),
	FOREIGN KEY(FileID) REFERENCES File(ID),
	UNIQUE (Signature, ClassID)
);
ALTER TABLE Function CONVERT TO CHARACTER SET latin1 COLLATE latin1_general_cs;
